import './App.css';

import React from "react";
import UsersList from "./components/Users";

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            'users': []
        };
    }

    render() {
        return (
            <UsersList users={this.state.users}/>
        )
    }
}


export default App;
